import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import ClassComponent from './components/learning-examples/ClassComponent.jsx';

class App extends Component {
  //parent componnet
  render() {
    return (
      <div className="App">
        <ClassComponent /> //child component
        <FunctionComponent />
      </div>
    );
  }
}

// Use a capital letter as the start of a custom component
function FunctionComponent() {
  return <div className="thirdComponent">Function Component</div>;
}
export default App;
